<!DOCTYPE html>
<html lang="zh-TW">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>3D 零件動態檢視: 3002770A.glb</title>
    <script type="module" src="https://unpkg.com/@google/model-viewer/dist/model-viewer.min.js"></script>
    <style>
      :root {
        --bg-deep: #020617;
        --panel-bg: rgba(15, 23, 42, 0.95);
        --border-light: rgba(255, 255, 255, 0.1);
        --accent-cyan: #06b6d4;
        --accent-blue: #3b82f6;
        --text-dim: #64748b;
        --text-normal: #94a3b8;
        --text-bright: #f1f5f9;
        --color-success: #10b981;
        --color-warning: #f59e0b;
        --color-danger: #ef4444;
      }
      html, body { height: 100%; width: 100%; margin: 0; padding: 0; overflow: hidden; background: var(--bg-deep); font-family: -apple-system, system-ui, sans-serif; }
      
      model-viewer { 
        width: 100%; 
        height: calc(100% - 120px); 
        background-color: #1f2937; 
      }
      
      .bottom-panel {
        position: fixed; bottom: 0; left: 0; right: 0; height: 120px;
        background: var(--panel-bg); backdrop-filter: blur(15px);
        border-top: 1px solid var(--border-light);
        display: flex; flex-direction: column; padding: 12px 24px; box-sizing: border-box;
        color: var(--text-normal); z-index: 1000; box-shadow: 0 -10px 25px rgba(0,0,0,0.5);
      }
      
      .lifecycle-text-row {
        display: flex; align-items: center; gap: 15px; font-size: 11px; margin-bottom: 10px;
        border-bottom: 1px solid rgba(255,255,255,0.05); padding-bottom: 8px;
      }
      .section-label { font-weight: 900; color: #fff; text-transform: uppercase; white-space: nowrap; letter-spacing: 0.05em; }
      .items-wrap { display: flex; gap: 20px; overflow-x: auto; white-space: nowrap; flex: 1; align-items: center; }
      .items-wrap b { color: var(--text-bright); }
      
      .date-picker-mini {
        background: rgba(255,255,255,0.05); border: 1px solid var(--border-light); color: var(--text-bright);
        font-size: 11px; border-radius: 4px; padding: 2px 6px; outline: none; transition: border-color 0.2s;
      }
      .date-picker-mini:focus { border-color: var(--accent-cyan); }

      .controls-row { display: flex; align-items: center; justify-content: space-between; gap: 24px; flex: 1; }
      .left-settings { display: flex; align-items: center; gap: 18px; }
      .control-item { display: flex; flex-direction: column; gap: 2px; }
      .control-item label { font-size: 9px; font-weight: 900; color: var(--text-dim); text-transform: uppercase; }

      .color-picker { width: 30px; height: 20px; border-radius: 4px; border: 1px solid #334155; background: none; cursor: pointer; padding: 0; }
      .slider { width: 80px; height: 4px; background: #1e293b; border-radius: 2px; appearance: none; outline: none; }
      .slider::-webkit-slider-thumb { appearance: none; width: 12px; height: 12px; background: var(--accent-cyan); border-radius: 50%; cursor: pointer; border: 2px solid #0f172a; }

      .progress-area { flex: 1; max-width: 480px; display: flex; flex-direction: column; gap: 5px; }
      .progress-labels { display: flex; justify-content: space-between; font-size: 10px; font-weight: 800; color: var(--text-dim); text-transform: uppercase; }
      .progress-labels b { color: var(--text-normal); font-weight: 900; }
      .progress-bar-container { position: relative; width: 100%; height: 8px; background: #1e293b; border-radius: 4px; overflow: visible; }
      .progress-fill { height: 100%; border-radius: 4px; transition: width 0.5s cubic-bezier(0.4, 0, 0.2, 1), background-color 0.5s; }
      .progress-handle { 
        position: absolute; top: 50%; transform: translateY(-50%); width: 14px; height: 14px; 
        background: var(--accent-cyan); border: 2px solid #020617; border-radius: 50%; transition: left 0.5s cubic-bezier(0.4, 0, 0.2, 1);
        box-shadow: 0 0 10px rgba(6, 182, 212, 0.4);
      }

      .order-btn {
        background: #5d8bc3; color: white; border: none; padding: 10px 32px; border-radius: 6px;
        font-size: 16px; font-weight: 900; cursor: pointer; transition: all 0.2s cubic-bezier(0.4, 0, 0.2, 1);
        box-shadow: 0 4px 15px rgba(93, 139, 195, 0.2);
      }
      .order-btn:hover { background: #4a74a5; transform: translateY(-1px); box-shadow: 0 6px 20px rgba(93, 139, 195, 0.4); }
      .order-btn:active { transform: scale(0.96); }

      .dropdown-mini { background: #1e293b; color: #fff; border: 1px solid var(--border-light); border-radius: 4px; font-size: 11px; padding: 2px 6px; }

      .sync-indicator {
        display: inline-block; width: 8px; height: 8px; border-radius: 50%; background: var(--color-success);
        margin-left: 8px; animation: pulse 2s infinite;
      }
      
      @keyframes pulse {
        0%, 100% { opacity: 1; }
        50% { opacity: 0.5; }
      }

      @media (max-width: 1024px) {
        .bottom-panel { height: auto; min-height: 160px; }
        model-viewer { height: calc(100% - 160px); }
        .controls-row { flex-direction: column; align-items: stretch; gap: 15px; }
        .items-wrap { flex-wrap: wrap; gap: 10px; }
      }
    </style>
</head>

    const lifespan = "6年";
    const installDateInput = document.getElementById('install-date-input');
    const baseDateInput = document.getElementById('base-date-input');
    const syncIndicator = document.getElementById('sync-indicator');

    const STORAGE_KEY_PREFIX = 'part_install_date_';

    // 初始化基準日為今日
    const today = new Date();
    baseDateInput.value = today.toISOString().split('T')[0];

    function flashSyncIndicator() {
      syncIndicator.style.background = 'var(--accent-cyan)';
      syncIndicator.style.boxShadow = '0 0 10px var(--accent-cyan)';
      setTimeout(() => {
        syncIndicator.style.background = 'var(--color-success)';
        syncIndicator.style.boxShadow = 'none';
      }, 500);
    }

    function updateLifecycle() {
      if (!installDateInput.value || !baseDateInput.value) return;
      const installDate = new Date(installDateInput.value);
      const baseDate = new Date(baseDateInput.value);
      
      let totalLifespanDays = 0;
      const yearMatch = lifespan.match(/(\d+)\s*年/);
      const hourMatch = lifespan.match(/(\d+)\s*小時/);
      if (yearMatch) totalLifespanDays = parseFloat(yearMatch[1]) * 365.25;
      else if (hourMatch) totalLifespanDays = parseFloat(hourMatch[1]) / 8;

      const oneDay = 24 * 60 * 60 * 1000;
      const usedDays = Math.round((baseDate - installDate) / oneDay);
      const progressPercent = Math.min(100, Math.max(0, (usedDays / totalLifespanDays) * 100));
      const remainingDays = Math.floor(totalLifespanDays - usedDays);
      
      const recommendDate = new Date(installDate);
      recommendDate.setDate(recommendDate.getDate() + Math.round(totalLifespanDays));

      document.getElementById('text-used').innerHTML = '已使用 <b>' + Math.max(0, usedDays) + '天</b>';
      document.getElementById('text-percent').innerText = progressPercent.toFixed(1) + '%';
      document.getElementById('progress-percent-text').innerText = progressPercent.toFixed(1) + '%';
      document.getElementById('text-remaining').innerHTML = '剩餘 <b>' + remainingDays + '天</b>';
      document.getElementById('display-recommend-date').innerText = recommendDate.toLocaleDateString('zh-TW');
      
      const fill = document.getElementById('progress-bar-fill');
      const handle = document.getElementById('progress-handle');
      fill.style.width = progressPercent + '%';
      handle.style.left = 'calc(' + progressPercent + '% - 7px)';

      let status = '正常'; let statusColor = 'var(--accent-cyan)';
      if (remainingDays < 0) { status = '已過期'; statusColor = 'var(--color-danger)'; }
      else if (remainingDays <= 182) { status = '警告'; statusColor = 'var(--color-warning)'; }
      
      const statusEl = document.getElementById('display-status');
      statusEl.innerText = status; statusEl.style.color = statusColor;
      fill.style.backgroundColor = statusColor;
      handle.style.backgroundColor = statusColor;
    }

    // ========== 連動邏輯 (Storage 與 list.html 同步) ==========
    function loadFromStorage() {
      const savedDate = localStorage.getItem(STORAGE_KEY_PREFIX + partNo);
      if (savedDate && savedDate !== installDateInput.value) {
        installDateInput.value = savedDate;
        flashSyncIndicator();
        updateLifecycle();
      }
    }

    window.addEventListener('storage', (e) => {
      if (e.key === STORAGE_KEY_PREFIX + partNo) loadFromStorage();
    });

    installDateInput.addEventListener('change', () => {
      localStorage.setItem(STORAGE_KEY_PREFIX + partNo, installDateInput.value);
      updateLifecycle();
    });

    const applyMaterial = () => {
      if (!modelViewer.model) return;
      const hex = document.getElementById('mat-color').value;
      const r = parseFloat(document.getElementById('roughness').value);
      const m = parseFloat(document.getElementById('metalness').value);
      const rgb = [parseInt(hex.substring(1,3), 16)/255, parseInt(hex.substring(3,5), 16)/255, parseInt(hex.substring(5,7), 16)/255];
      modelViewer.model.materials.forEach(mat => {
        if (mat.pbrMetallicRoughness) {
          mat.pbrMetallicRoughness.setBaseColorFactor([...rgb, 1]);
          mat.pbrMetallicRoughness.setRoughnessFactor(r);
          mat.pbrMetallicRoughness.setMetallicFactor(m);
        }
      });
    };

    // ========== 訂購按鈕智能路徑偵測 ==========
    const orderButton = document.getElementById('order-button');
    if (orderButton) {
      orderButton.addEventListener('click', () => {
          const currentPath = window.location.pathname;
          let orderUrl;
          if (currentPath.includes('Component/original/')) {
              orderUrl = "../../OrderSystem/order_system.html?part_code=" + encodeURIComponent(partNo);
          } else if (currentPath.includes('Component/')) {
              orderUrl = "../OrderSystem/order_system.html?part_code=" + encodeURIComponent(partNo);
          } else {
              orderUrl = "OrderSystem/order_system.html?part_code=" + encodeURIComponent(partNo);
          }
          window.open(orderUrl, "_blank");
      });
    }

    modelViewer.addEventListener('load', () => {
      applyMaterial(); loadFromStorage(); updateLifecycle();
      document.getElementById('bg-color').addEventListener('input', e => modelViewer.style.backgroundColor = e.target.value);
      document.getElementById('mat-color').addEventListener('input', applyMaterial);
      document.getElementById('roughness').addEventListener('input', applyMaterial);
      document.getElementById('metalness').addEventListener('input', applyMaterial);
      baseDateInput.addEventListener('change', updateLifecycle);
      
      
    });
  </script>
</body>
</html>
